import { Fragment } from "react";

export default (props) => {
    return <Fragment>
        <style jsx>{`
            .relative{
                position: relative;
            }
            .relative input{
                border: none;
                outline: none;
                padding: 10px 20px;
            }
        `}</style>
        <div className="relative">
            <label>{props.label}</label>
            <input value={props.value} onChange={props.onChange} />
        </div>
    </Fragment>
}
